script: |
  super -f text -I q11300.spq | sort > q11300.out

inputs:
  - name: q11300.spq
    data: |
      SELECT + col0 * col1 AS col0 FROM tab2 (FORMAT parquet) WHERE - - col0 NOT BETWEEN + col0 + CAST ( NULL AS INTEGER ) AND col1 + - 95 * - col0;
  - name: tab2

outputs:
  - name: q11300.out
    data: |
